<h2 id="8.1">8.1. Introdução</h2>
<p>A indústria de alimentos teve sua origem nas fazendas, sítios e plantações com a produção e processamento em pequena escala. Assim sendo, no início, os produtos apresentavam um gênero mais caseiro e sem padrões de produção definidos. Contudo, a massificação e a busca por produtos pré-processados levaram a um aumento da especialização e a otimização da produção alimentar. Essa otimização só foi possível com a instituição de padrões e graus de qualidade nas vilas e comunidades, tais como os instituídos no processamento e distribuição do leite, na moagem de grãos, nos métodos de conservação e distribuição de alimentos perecíveis (carnes, frutas e legumes), dentre outros.</p>
<p>Hoje em dia, toda a produção alimentar é centralizada em grandes centros ou indústrias monoprodutoras, que compram boa parte da matéria-prima das antigas fontes manufatureiras. Consequentemente, a indústria de alimentos transforma os produtos das fazendas em materiais apropriados ao consumo a partir do seu processamento. Processamento este que, como será apresentado adiante, é muitas vezes semelhante ao processamento de substâncias químicas, logo, químicos, engenheiros químicos e tecnólogos são tão importantes no seu desenvolvimento, quantos os engenheiros agrônomos e de alimentos.</p>
<p>Atualmente, a Associação Brasileira das Indústrias da Alimentação (ABIA) concentra a produção nacional de alimentos industrializados nos seguintes setores:</p>
<ul>
    <li>Alimentos calóricos (Protéicos)</li>
    <li>Açúcar</li>
    <li>Café</li>
    <li>Chá</li>
    <li>Carnes, embutidos, etc. </li>
    <li>Cereais</li>
    <li>Chocolates, cacau e balas</li>
    <li>Condimentos</li>
    <li>Desidratados e liofilizados ·</li>
    <li>Bebidas</li>
    <li>Alcoólicas</li>
    <li> Refrigerantes</li>
    <li>Sucos (concentrados e pós)</li>
    <li>Vinagres</li>
    <li>Aromatizantes</li>
    <li>Embalagens</li>
    <li>Matéria-prima para alimentos</li>
    <li>Diversos</li>
    <li>Dietéticos</li>
    <li>Frutas e legumes</li>
    <li>Lacticínios e derivados</li>
    <li>Massas, biscoitos, congêneres</li>
    <li>Óleos, gorduras, azeites, margarinas e maioneses</li>
    <li>Pescado e derivados</li>
    <li>Sopas e caldos</li>
    <li>Sorvetes</li>
    <li>Supergelados</li>
    <li>Afins</li>
</ul>
<p>A seguir serão apresentadas as principais fases do processamento de alimentos que serão exemplificadas a partir da tecnologia de produção de dois setores produtivos. </p>

<h2 id="8.2">8.2. Processamento de alimentos</h2>
<p>O processamento de produtos alimentícios é bem semelhante aos demais processos já apresentados pela tecnologia química, principalmente, quanto aos equipamentos e processos tecnológicos envolvidos. Destaque especial é dado aos processos de pasteurização, secagem, desidratação, esterilização, congelamento, desenvolvimento de materiais para armazenamento, manuseio, automação, limpeza e sanitização. Porém, o avanço mais importante, durante todo Século XX, foi o uso do aço inoxidável para o processamento de alimentos. Esse material, resistente à corrosão, permitiu o desenvolvimento de processos contínuos e automatizados empregando um ambiente asséptico. </p>
<p>De forma genérica, as principais fases do processamento de produtos alimentícios são: beneficiamento, elaboração, preservação e/ou conservação e armazenamento.</p>
<p>A <span class="bold">fase de beneficiamento</span> é a primeira etapa do processamento da matéria-prima e se divide em: colheita (ou abate), transporte, limpeza, classificação e seleção. Durante a colheita a matéria-prima passa por uma série de procedimentos preliminares de acordo com a sua origem e destino, sendo em seguida transportada de forma adequada para a usina de processamento. Já na usina de processamento, a etapa de limpeza pode ser realizada pela remoção física de resíduos, separação das partes não comestíveis e higienização do produto. </p>
<div class="box">
    <p>As partes rejeitadas são empregadas tradicionalmente na preparação de subprodutos.</p>
</div>
<p>A subdivisão por tamanho e granulometria é realizada durante a classificação. Por fim, é realizada uma seleção do produto de acordo com o seu destino e de suas qualidades organolépticas, físicas, químicas e microbiológicas.</p>
<p>A <span class="bold">fase de elaboração</span> é a etapa de maior importância no processamento de alimentos, pois nela se desenvolvem diversas operações de natureza física, química e biológica que caracterizam os produtos. </p>
<p>A partir do processamento tecnológico de alimentos básicos, tais como o leite, carne, pescado, ovos, frutas e vegetais é possível obter uma variedade maior de produtos. Os principais processos tecnológicos usados na fase de elaboração são:</p>
<ul>
    <li><span class="bold">Processos físicos:</span> moagem, trituração, esmagamento ou prensagem e aplicação de calor;</li>
    <li><span class="bold">Processos químicos: </span> extração por solvente, acidificação, aditivação e salga;</li>
    <li><span class="bold">Processos físico-químicos: </span>refinação, hidrolização, dissolução, emulsificação, caramelização e cristalização;</li>
    <li><span class="bold">Processos biológicos: </span>fermentação e maturação.</li>
</ul>
<p>Dentre os processos físicos empregados no beneficiamento de produtos alimentícios podemos destacar a operação de moagem. A moagem é empregada para promover o aumento da superfície de contato da matéria-prima, facilitando o desenvolvimento das etapas posteriores, tais como, a extração, a secagem e a homogeneização. Ela é muito empregada na moagem de grãos, como o milho, a soja e a mostarda, usando um equipamento chamado de moinho. A Figura 8.1 apresenta os principais modelos de moinhos usados no processamento de alimentos.</p>
