<p>Esse processo é bastante empregado para a extração de óleo de sementes e pode ocorrer de forma mista, envolvendo uma pré-prensagem com posterior extração com solvente.</p>
<p>A <span class="bold">fase de preservação e/ou conservação</span> tem início no transcorrer final da fase de elaboração. Esse cuidado é necessário para evitar a contaminação do produto, que deve ser acondicionado, como veremos a seguir, de forma e em condições adequadas, para garantir um maior tempo de vida útil do produto final. Os processos usados nessa etapa visam, especialmente, à eliminação da flora microbiana normal inconveniente e da patogênica, assim como das enzimas produtoras de alterações. Os tipos de tratamento existentes são:</p>
<p><span class="bold">1. Conservação pelo calor:</span> baseia-se no emprego de temperaturas ligeiramente acima das temperaturas máximas que permitem a multiplicação dos microrganismos, de forma a provocar a sua morte ou a inativação de suas células vegetativas. Os principais métodos de conservação por calor são: pasteurização, esterilização, tindalização e apertização.</p>
<p>A pasteurização é um tratamento térmico relativamente suave que emprega temperaturas inferiores a 100 ºC. Ela tem como principal objetivo prolongar a vida de prateleira dos alimentos, por alguns dias, como no caso do leite ou por alguns meses, como ocorre com as frutas enlatadas. Este método tem como princípio, a inativação de enzimas e a destruição dos microorganismos sensíveis a temperaturas mais elevadas, como as bactérias vegetativas, bolores e leveduras, sem, contudo, modificar significativamente o valor nutritivo e as características organolépticas do alimento submetido a esse tratamento. </p>
<p>Basicamente, existem três tipos de pasteurização. A pasteurização lenta, que aplica temperaturas mais baixas (da ordem de 65 °C) durante maior tempo (30 min ou mais). A pasteurização rápida, quando se aplicam temperaturas mais altas, da ordem dos 75 °C, durante alguns segundos. Este tipo de pasteurização é, por vezes, denominado HTST (do inglês <em>High Temperature and Short Time</em>), ou simplesmente "alta temperatura e curto tempo". Por fim temos a pasteurização muito rápida, quando a temperatura varia entre 130 e 150 °C, de três a cinco segundos. Também conhecido como UHT (do inglês, <em>Ultra High Temperature</em>) ou simplesmente "temperatura ultra-elevada". A Figura 8.3 mostra uma foto do sistema de purificação UHT.</p>
<!-- FIGURA 8.3 -->
<figure>
    <img src="img/fig-8-3.jpg" alt="audiodescrição">
    <figcaption><span class="bold">Figura 8.3. </span>Sistema de purificação UHT para sucos de frutas, leite e outras bebidas semelhantes. Fonte: <a href="https://www.alibaba.com/product-detail/Tubular-Pasteurized-Tubular-UHT-Milk-Pasteurized_1600339333795.html?spm=a2700.galleryofferlist.normal_offer.d_title.12d216d0mrPfG5&s=p" target="_blank" rel="noopener noreferrer">Alibaba</a>.</figcaption>
</figure>
<p>A esterilização pelo calor é o tratamento no qual o alimento é aquecido a uma temperatura relativamente elevada durante períodos variados de tempo, suficientes para a destruição dos microorganismos e inativação das enzimas capazes de deteriorar o produto durante o armazenamento. Este tratamento pode ser realizado por diversos processos, dentre eles: a flambagem, a fervura, a aplicação de calor seco e a aplicação de calor úmido ou autoclavagem. </p>
<p>Diferente dos demais, na tindalização o aquecimento é feito de maneira descontínua. Após o acondicionamento das matérias-primas alimentícias, a serem submetidas ao tratamento, em recipiente fechado, o produto é submetido ao tratamento térmico. Dependendo de cada produto e do rigor térmico desejado, as temperaturas variam de 60 a 90 °C, durante alguns minutos. As células bacterianas que se encontram na forma vegetativa são destruídas, porém os esporos sobrevivem. Depois do resfriamento, os esporos entram em processo de germinação e depois de 24 horas a operação é repetida. O número de operações pode variar de 3 a 12 vezes até a obtenção da esterilização completa. A vantagem desse processo é que podem ser mantidos praticamente todos os nutrientes e as qualidades organolépticas do produto, em proporções maiores do que quando se utilizam outros tratamentos térmicos.</p>
<p>Por fim, a apertização é a aplicação do processo térmico a um alimento convenientemente acondicionado em uma embalagem hermética, resistente ao calor, a uma temperatura e um período de tempo cientificamente determinados, para atingir a esterilização comercial. Este processo corresponde ao aquecimento do produto já elaborado, envasado em latas, vidros, plásticos ou outros materiais e relativamente isentos de ar.</p>
<p><span class="bold">2. Conservação pelo frio:</span> diferentemente da conservação pelo calor, a conservação pelo frio emprega temperaturas abaixo da temperatura ambiente para retardar as reações químicas e as atividades enzimáticas, bem como para retardar ou inibir o crescimento e a atividade dos microrganismos nos alimentos. Pode ser dar por refrigeração ou congelamento.</p>
<p><span class="bold">3. Conservação pelo controle da umidade:</span> geralmente, ambientes que apresentam ausência de água ou são desidratados apresentam uma redução da atividade enzimática e microbiana, uma vez que sua proliferação é minimizada. As principais técnicas usadas são: secagem natural, desidratação ou secagem artificial. </p>
<p><span class="bold">4. Conservação pela adição de um soluto:</span> a adição elevada de quantidades de açúcar ou sal ao alimento pode reter quantidades variadas de água, o que resulta em um estado qualificado de controle da pressão osmótica. A preservação de frutas pela adição de açúcar, transformando-as em geleias, doces em massa e outros produtos similares ocorre pela elevada concentração de açúcar. Estes produtos contêm em média de 25 a 33% de umidade, mas podem ser conservados sem maiores problemas. O sal também é bastante eficaz na preservação de carnes e peixes.</p>
<p><span class="bold">5. Conservação por defumação: </span>consiste no processo de aplicação de fumaça aos produtos alimentícios, produzida pela combustão incompleta de algumas madeiras previamente selecionadas. Normalmente é realizado em conjunto com a salga, a cura, a fermentação e outros processos. Em carnes, o contato com o calor e a fumaça provoca a perda da água, gerando uma superfície ressecada e de coloração estabilizada. A perda de água e a ação dos constituintes da fumaça conferem ao alimento barreiras físicas e químicas eficientes contra a penetração e a atividade de microorganismos. Essa capa protetora pode ser devido à desidratação que se processa na superfície do produto (principalmente na defumação a quente), à coagulação proteica que ocorre durante a defumação e ao depósito das substâncias antimicrobianas que existem na fumaça, que se condensam e ficam depositadas na superfície do produto. </p>
<p><span class="bold">6. Conservação por fermentação:</span>emprega o crescimento controlado de microrganismos selecionados, capazes de modificar sua textura, sabor e aroma, como também suas propriedades nutricionais.</p>
<p>A fermentação alcoólica é usada na elaboração de bebidas alcoólicas entre as quais temos as fermentadas (vinhos e cervejas) e as fermento-destiladas (aguardente, rum, uísque, conhaque, tequila, gim, etc.). Nesses processos, transformam-se açúcares solúveis em etanol como produto principal. A transformação de glicose ou outro monossacarídeo em duas moléculas de álcool e gás carbônico é feita graças à presença de certas enzimas elaboradas por leveduras. Entre as leveduras mais utilizadas na fermentação alcoólica encontra-se <em>Saccharomycies cerevisiae</em>, usada na elaboração de vinhos e as espécies <em>S. carlsbergensis</em> e <em>S. uvarum</em> usadas na produção de cerveja.</p>
<p>Outro processo bem conhecido é a fermentação acética, amplamente utilizada na indústria de alimentos para produção de vinagre, pela oxidação do álcool por bactérias acéticas, como <em>Acetobacter</em> e <em>Gluconobacter</em>. Porém, várias espécies acéticas podem oxidar o álcool a ácido acético, mas muitas delas também podem oxidar o ácido acético a gás carbônico e água, o que é indesejável, quando se tem como objetivo a produção do vinagre.</p>
<div class="box">
    <p>Essa cultura de microorganismos é conhecida como "cultura <em>starter</em>".</p>
</div>
<p><span class="bold">7. Conservação pela adição de aditivos:</span> apesar de poder contribuir para a conservação dos alimentos, deve ser usada com moderação, uma vez que, a ingestão excessiva de alimentos conservados por aditivos químicos pode provocar perturbações no equilíbrio fisiológico do consumidor. </p>
<p><span class="bold">8. Conservação pelo uso da irradiação:</span> sob ponto de vista tecnológico, satisfaz plenamente o objetivo de proporcionar aos alimentos, a estabilidade química e microbiológica, condições sanitizante e longo período de armazenamento. No entanto, ainda apresenta uso limitado. </p>


<h2 id="8.3">8.3. Tecnologia química de alguns setores da indústria alimentícia</h2>
<p>Como já foi visto no início do capítulo, diversos são os setores da indústria alimentícia brasileira, sendo inviável a apresentação individual de cada um deles. Portanto, para exemplificar as principais fases e operações realizadas na indústria de processamento de alimento, destacaremos apenas dois setores da produção de alimentos.</p>
<h3>8.3.1. Processamento do leite</h3>
<p>O processamento do leite tem início após a ordenha. Na primeira etapa, o leite é armazenado num aparelho de refrigeração a uma temperatura entre 0 e 4 °C, portanto ela é conhecida como etapa de arrefecimento. Posteriormente, ele é recolhido por um caminhão cisterna com sistema de refrigeração de mesma temperatura. </p>
<p>A matéria-prima é recebida nas fábricas onde são imediatamente recolhidas amostras do leite cru para a realização de análises físico-químicas e microbiológicas. Em seguida, conforme a acidez e outras características organolépticas, o leite é separado. Só então, o leite passa por outra etapa de arrefecimento que pode ir dos 4 °C a 2 °C, num permutador de placas, e é armazenado por um período máximo de 24 horas. </p>
<p>Após a recepção, o leite segue para a termização, que consiste em um tratamento térmico de menor intensidade do que a pasteurização, usualmente empregando temperaturas entre 60 e 69 °C por 15-20 segundos, evitando o crescimento de contaminantes psicotróficos (<em>Pseudomonas</em> s.p), e a formação de lipases e proteinases termo resistentes. </p>
<p>No processo seguinte de desnatação, é retirado o máximo de gordura do leite através de uma desnatadeira. Este processamento torna-se mais eficaz a temperaturas mais elevadas em virtude da menor viscosidade do leite. Segue-se a normalização que tem como objetivo o ajuste e a estabilização do teor de gordura no leite.</p>
<div class="box">
    <p>De acordo com o teor de gordura o leite pode ser classificando como gordo (3,5% de teor de gordura), meio gordo (1,5% de teor de gordura) e magro (vestígios de gordura).</p>
</div>
<p>Na homogeneização o leite passa por um processo de distribuição uniforme da gordura para evitar a formação de nata. Este processo melhora a estabilidade e consistência do leite. Depois ocorre a pasteurização via processo UHT, realizada a altas temperaturas (130 °C, entre 2 e 4 segundos) para assegurando a destruição completa de bactérias resistentes ao calor, formadoras de esporos (bacilos de Cock), tornado o leite estéril. Este processo inclui um rápido resfriamento para minimizar qualquer dano ao produto.</p>
<p>Por fim, segue-se a etapa de enchimento asséptico, armazenagem à temperatura ambiente e a expedição do produto final para os vários postos de venda.</p>
<div class="box">
    <p>As embalagens usadas para o armazenamento do leite são compostas por um material cartonado formado por seis camadas compostas por polietileno, papel e alumínio de forma asséptica para evitar a recontaminação do leite e aumentar a sua vida de prateleira. </p>
</div>

<div class="atv">
