    <p>Faça um fluxograma simplificado do processo de processamento do leite.</p>
</div>

<h3>8.3.2. Processamento do óleo de soja</h3>
<p>A soja é um dos principais produtos agrícolas comercializados no mundo. Atualmente, os principais países produtores (Estados Unidos, Brasil e Argentina) são também os principais exportadores. O Brasil é o segundo maior produtor da oleaginosa, com 22,1% da produção e responde por 22,4% das exportações mundiais, ocupando também a segunda colocação nas vendas de derivados ao exterior. Cerca de 90% da produção de óleo vegetal e farelo proteico no Brasil são oriundos da soja. Isso significa que a indústria esmagadora brasileira é fortemente dependente dessa cultura, por ser a única oleaginosa produzida em larga escala no país. </p>
<p>A industrialização das sementes de soja divide-se em duas partes principais: produção do óleo bruto e refino.</p>
<h4>I. Produção do óleo bruto</h4>
<p>A produção de óleo bruto se inicia com o armazenamento das sementes e depende diretamente do fator umidade, já que os grãos têm a propriedade de absorver e ceder água para a atmosfera que os envolve. Essa troca de água tende a gerar um equilíbrio onde a tensão de vapor de água dentro do grão nivela-se à pressão de água contida no ar. </p>
<div class="box">
    <p>Tal equilíbrio é chamado de equilíbrio higroscópico. </p>
</div>
<p>As condições que levam a uma intensa atividade respiratória da semente são igualmente favoráveis ao crescimento das bactérias e mofos, ocasionando a deterioração dos grãos armazenados. Portanto, as sementes são melhores armazenadas com baixa umidade, onde o crescimento do mofo e de outros eventuais danos as sementes serão minimizados.</p>
<p>Os grãos de soja colhidos nos campos são transportados via rodovia ou ferrovia até as fábricas. Na fábrica são realizados os primeiros controles para a armazenagem destes grãos, como o teor de umidade, quantidade de material estranho e incidência de grãos “danificados”. Realiza-se também a pré-limpeza, que nada mais é do que a retirada de impurezas mais grossas (galhos, meio grãos, etc.) antes do armazenamento. Essa etapa é realizada em máquinas especiais dotadas de peneiras vibratórias e visa diminuir o risco de deterioração e maximizar o espaço útil do silo. </p>
<p>Em seguida, o grão é preparado para extração via uma limpeza, para eliminação de impurezas vegetais, minerais e metálicas, mediante peneiramento, aspiração e separação magnética. Ele passa também por uma etapa de ruptura, para reduzir os grãos em pedaços de 1/4 a 1/6 do tamanho do grão inteiro.</p>
<p>Quando se deseja produzir um farelo com alto conteúdo proteico, realiza-se a etapa de descascamento, seguido do sistema de separação das cascas. Já que os grãos de soja estão recobertos em média com 8% de cascas e a operação de descascamento traz a vantagem do aumento do conteúdo proteico de 44% para 48%. </p>
<p>Posteriormente, os grãos passam por um condicionamento térmico por meio de aquecimento a 65 °C em condicionadores do tipo vertical ou, mais comumente, do tipo horizontal. Depois, os grãos passam por um processo de laminação para facilitar o rompimento do tecido e das paredes das células, diminui a distância entre o centro da célula e a superfície, aumentando a superfície de saída de óleo. Obtêm-se, desta forma, flocos com 0,2 a 0,4 mm de espessura por um diâmetro equivalente de 10 a 30 mm.</p>
<p>Só então esse material passa por um cozimento para promover o rompimento das paredes das células e facilitar a saída do óleo. O cozimento ocorre em um aparelho chamado “chaleira” que é composto por 4 ou 5 bandejas sobrepostas, aquecidas a vapor direto ou indireto. Durante essa etapa, eleva-se a temperatura dos flocos laminados e se aumenta a umidade do sistema. Com o aumento da umidade dos flocos e o rompimento das paredes da célula, se consegue facilitar a saída do óleo. Nas bandejas superiores as sementes são submetidas ao vapor direto e indireto, já na última bandeja ocorre à secagem dos grãos.</p>
<p>Por fim, tem-se a extração do óleo bruto, que pode ser feita por prensagem mecânica e/ou com a utilização de solventes. </p>
<p>A prensagem mecânica é efetuada modernamente por prensas contínuas, que são usadas para uma remoção parcial do óleo, seguida por extração com o solvente, constituindo o processo misto. A prensagem mecânica é realizada sob alta pressão reduzindo o conteúdo de óleo na torta em até 5%. </p>
<p>Já na extração por solvente, a obtenção da matéria oleosa é feita por meio de um solvente proveniente da mistura de hidrocarbonetos (hexano) com uma fração de petróleo, com ponto de ebulição de 70 °C. Para facilitar a penetração do solvente no interior das sementes, o material a ser extraído é triturado e laminado. </p>
<h4>II. Refino</h4>
<p>Para ser usado em larga escala pela indústria alimentícia, o óleo bruto de soja tem que passar pelo processo de refinação. O processo de refinação tem como finalidade melhorar a aparência, odor e sabor do óleo, o que ocorre devido à remoção de:</p>
<ul>
    <li> Substâncias coloidais, proteínas fosfatídeos e produtos de sua decomposição; </li>
    <li> Ácidos graxos livres e seus sais, ácidos graxos oxidados, lactonas, acetais e polímeros;</li>
    <li> Corantes, tais como clorofila, xantofila, carotenoides; </li>
    <li> Substâncias voláteis, tais como hidrocarbonetos, alcoóis, aldeídos, cetonas e ésteres de baixo peso molecular;</li>
    <li> Substâncias inorgânicas, tais como: sais de cálcio e de outros metais, silicatos, fosfatos e outros;</li>
    <li> Umidade.</li>
</ul>
<p>As principais etapas do processo de refino são: degomagem, neutralização e branqueamento.</p>
<p>A degomagem ou hidratação visa remover do óleo bruto fosfatídeos, proteínas e substâncias coloidais, reduzindo a quantidade de álcali durante a subsequente neutralização, de forma a diminuir as perdas de refinação. O método de degomagem mais utilizado consiste na adição de 1 a 3% de água ao óleo aquecido de 60 a 70 °C e agitado durante 20 a 30 minutos. Forma-se um precipitado que é removido do óleo por centrifugação a 5000-6000 rpm. As gomas obtidas no processo que contiverem cerca de 50% de umidade são secas sob vácuo a uma temperatura de 70 a 80 °C. O produto obtido é chamado de lecitina comercial e consiste em cerca de 60% de mistura de fosfatídeos (lecitina, cefalina e fosfatidil-inositol), 38% de óleo e 2% de umidade. </p>
<p>A degomagem também pode ser feita por meio da injeção de água ao óleo aquecido ou misturando 0,1 a 0,4% de ácido fosfórico a 85% com o óleo a uma temperatura de 60 a 65 °C, seguido pela adição de 0,2% de terra branqueadora, e pela separação das gomas por filtração ou centrifugação.</p>
<p>Já a neutralização ocorre na interfase do óleo e da solução alcalina, uma vez que essas fases não são miscíveis. A neutralização exige, portanto, uma dispersão de solução alcalina em óleo.</p>
<p>Geralmente, o processo de degomagem e neutralização com álcalis já removem certa quantidade de corantes do óleo, produzindo um efeito branqueador. Entretanto, atualmente, são exigidos óleos e gorduras quase incolores, o que é possibilitado pela absorção dos corantes com terras clarificantes, naturais ou ativadas, às vezes, misturadas com carvão ativado na proporção de 10:1 a 20:1.</p>
<p>As terras ativadas são preparadas com silicatos de alumínio, por aquecimento com ácido clorídrico ou sulfúrico, removendo quase todo cálcio e magnésio e parcialmente o ferro e alumínio, seguido por lavagem com água, secagem e moagem. As terras naturais têm um poder clarificante bem inferior ao das terras ativadas, porém são bem mais baratas. </p>
<p>Como a ação da terra clarificante é mais eficiente em meio anidro e o óleo neutralizado sempre contém umidade, é necessário realizar uma pré-etapa de secagem. A secagem do óleo é feita de maneira contínua no processo de neutralização. Já no processo de branqueamento ela é feita aquecendo o material à temperatura de 80 a 90 °C sob vácuo (30 mm Hg) por 30 minutos. Em seguida, se adiciona terra clarificante por sucção, agitando o óleo com uma temperatura de 80 a 95 °C, durante 20 a 30 minutos. Subsequentemente, o óleo é resfriado de 60 a 70 °C e filtrado por filtro-prensa. </p>

